    // Create Floating Window
    function erm_CreateWindow()
    {
        // Window already created
        if(erm_UICreated) return;

        // Create Window
        let pos1 = 0, pos2 = 0, pos3 = 0, pos4 = 0;

        // Floating Content
        let erm_WindowContent = document.createElement('div');
        erm_WindowContent.id = 'erm_WindowContent';
        erm_WindowContent.setAttribute('style', 'height: calc(100% - 26px); position: initial; margin-top: 26px;');

        // Close Window Icon
        let erm_closeWindow = document.createElement('img');
        erm_closeWindow.alt = '(X)';
        erm_closeWindow.src = erm_CloseIcon.src;

        // Top Overlay
        let erm_TopOverlay = document.createElement('div');
        erm_TopOverlay.id = 'erm_TopOverlay';
        erm_TopOverlay.setAttribute('style', 'cursor: move; width: 100%;');
        erm_TopOverlay.appendChild(erm_closeWindow);

        // Window Box
        let erm_WindowBox = document.createElement('div');
        erm_WindowBox.id = 'erm_WindowBox';
        erm_WindowBox.draggable = true;

        // Main Container
        let erm_MainContainer = document.createElement('div');
        erm_MainContainer.id = 'erm_MainContainer';

        erm_TopOverlay.onmousedown = (e) => {
            e = e || erm_MainContainer.event;
            e.preventDefault();
            // get the mouse cursor position at startup:
            pos3 = e.clientX;
            pos4 = e.clientY;
            document.onmouseup = () => {
                document.onmouseup = null;
                document.onmousemove = null;
            };
            // call a function whenever the cursor moves:
            document.onmousemove = (e) => {
                e = e || erm_MainContainer.event;
                e.preventDefault();
                // calculate the new cursor position:
                pos1 = pos3 - e.clientX;
                pos2 = pos4 - e.clientY;
                pos3 = e.clientX;
                pos4 = e.clientY;
                // set the element's new position:
                erm_WindowBox.style.top = (erm_WindowBox.offsetTop - pos2) + "px";
                erm_WindowBox.style.left = (erm_WindowBox.offsetLeft - pos1) + "px";
            };
        }
        erm_TopOverlay.appendChild(erm_closeWindow);
        erm_WindowBox.appendChild(erm_WindowContent);
        erm_WindowBox.appendChild(erm_TopOverlay);
        erm_MainContainer.appendChild(erm_WindowBox);

        let post_office = document.getElementById('post-office');
        if (post_office) {
            post_office.parentNode.insertBefore(erm_MainContainer, post_office.nextSibling);
        }
        erm_closeWindow.addEventListener('click', () => {
            erm_MainContainer.classList.remove('visible');
            erm_UIDisplayed = false;
        });

        // Window Created
        erm_UICreated = true;

        // Populate Window
        erm_Populate();

        // Draw Start Case
        erm_InitCase();
    }

