    function erm_DrawCase(caseName, playerOnCase)
    {
        // Start Case
        if(caseName == 'case0_0')
        {
            document.getElementById(caseName).style.background = 'url(' + erm_CorridorMap.src + ') 24px 48px';
            document.getElementById(caseName).style.backgroundColor = (playerOnCase) ? COLOR_CURRENTCASE : COLOR_0ZZ ;
            return;
        }

        // Case not visited
        if(!(caseName in erm_CaseData)) return;

        // The rest
        document.getElementById(caseName).style.background = 'url(' + erm_CorridorMap.src + ') ' + calculateOffset(erm_CaseData[caseName]);
        document.getElementById(caseName).style.backgroundColor = (playerOnCase) ? COLOR_CURRENTCASE : color_zz[erm_CaseData[currentCaseName].zz];

    }

    function erm_CleanCase(caseName)
    {
        document.getElementById(caseName).style.background = 'none';
        document.getElementById(caseName).style.backgroundColor = COLOR_BACKGROUND ;

        // Remove Door if there are nay
        if(document.getElementById(caseName).childElementCount == 1) document.getElementById(caseName).firstChild.remove();
    }

    function calculateOffset(caseItem)
    {
        // 4 Ways
        if(caseItem.allowNorth && caseItem.allowSouth && caseItem.allowEast && caseItem.allowWest) return '48px 48px'; // North + South + East + West
        // 3 Ways
        else if(caseItem.allowSouth && caseItem.allowEast && caseItem.allowWest) return '96px 96px'; // Everything except North
        else if(caseItem.allowNorth && caseItem.allowEast && caseItem.allowWest) return '72px 96px'; // Everything except South
        else if(caseItem.allowNorth && caseItem.allowSouth && caseItem.allowWest) return '48px 96px'; // Everything except East
        else if(caseItem.allowNorth && caseItem.allowSouth && caseItem.allowEast) return '24px 96px'; // Everything except West
        // 2 Ways Corner
        else if(caseItem.allowNorth && caseItem.allowEast) return '96px 24px';
        else if(caseItem.allowNorth && caseItem.allowWest) return '72px 24px';
        else if(caseItem.allowSouth && caseItem.allowEast) return '48px 24px';
        else if(caseItem.allowSouth && caseItem.allowWest) return '24px 24px';
        // 2 Ways Straight
        else if(caseItem.allowNorth && caseItem.allowSouth) return '72px 48px';
        else if(caseItem.allowEast && caseItem.allowWest) return '96px 48px';
        // Dead End
        else if(caseItem.allowNorth) return '96px 72px'; // Only North
        else if(caseItem.allowSouth) return '72px 72px'; // Only South
        else if(caseItem.allowEast) return '48px 72px'; // Only East
        else if(caseItem.allowWest) return '24px 72px'; // Only West
        else return 'FUCK';
    }

