    function erm_getCaseName(caseItem)
    {
        let caseName = 'case' + caseItem.x + '_' + caseItem.y;
        return caseName;
    }

    function erm_GetLastHistory()
    {
        return erm_MoveHistory[erm_MoveHistory.length-1];
    }

    function erm_InitCase()
    {
        // Start Case
        currentCase.x = 0;
        currentCase.y = 0;
        currentCaseName = erm_getCaseName(currentCase);
        erm_DrawCase(currentCaseName, true);

        // Add to Case Data & History
        erm_CaseData[currentCaseName] = {allowNorth:false, allowSouth: true, allowEast:false, allowWest:false};
        erm_MoveHistory.push({caseName: currentCaseName, from: 'NORTH'});
    }

    function erm_Move(direction)
    {
        // Control Limit
        if (direction == 'NORTH' && currentCase.y == 0) return;
        if (direction == 'SOUTH' && currentCase.y == 13) return;
        if (direction == 'EAST' && currentCase.x == 7) return;
        if (direction == 'WEST' && currentCase.x == -7) return;

        // We add Path from the previous case
        let previousCaseName = erm_GetLastHistory().caseName;
        if(previousCaseName != 'case0_0')
        {
            if(direction == 'NORTH') erm_CaseData[previousCaseName].allowNorth = true;
            else if(direction == 'SOUTH') erm_CaseData[previousCaseName].allowSouth = true;
            else if(direction == 'EAST') erm_CaseData[previousCaseName].allowEast = true;
            else if(direction == 'WEST') erm_CaseData[previousCaseName].allowWest = true;
        }

        // We Draw Previous Case // False = player not on this case
        erm_DrawCase(previousCaseName, false);

        // We set Current Case Now
        if (direction == 'NORTH') currentCase.y -= 1;
        if (direction == 'SOUTH') currentCase.y += 1;
        if (direction == 'EAST') currentCase.x += 1;
        if (direction == 'WEST') currentCase.x -= 1;

        // Get New Name
        currentCaseName = erm_getCaseName(currentCase);

        // If not previously visited add base
        if(!(currentCaseName in erm_CaseData)) erm_CaseData[currentCaseName] = {allowNorth:false, allowSouth: false, allowEast:false, allowWest:false, door:DOOR_NODOOR, zz:0};

        // Add Corridor from movement
        if (direction == 'NORTH') erm_CaseData[currentCaseName].allowSouth = true;
        if (direction == 'SOUTH') erm_CaseData[currentCaseName].allowNorth = true;
        if (direction == 'EAST') erm_CaseData[currentCaseName].allowWest = true;
        if (direction == 'WEST') erm_CaseData[currentCaseName].allowEast = true;

        // We draw the new Case
        erm_DrawCase(currentCaseName, true);

        // We then add it to history
        erm_MoveHistory.push({caseName: currentCaseName, from: direction});
    }

    function erm_RollBack()
    {
        // Can't remove if on Start Case
        if(erm_MoveHistory.length == 1) return;

        // Get Last Direction
        let lastDirection = erm_GetLastHistory().from;

        // Case to Clean
        let caseToClean = currentCaseName;

        // Back to Previous Case
        if(lastDirection == 'NORTH') currentCase.y += 1;
        if(lastDirection == 'SOUTH') currentCase.y -= 1;
        if(lastDirection == 'EAST') currentCase.x -= 1;
        if(lastDirection == 'WEST') currentCase.x += 1;
        currentCaseName = erm_getCaseName(currentCase);

        // Remove Corridor to Previous Case
        if(lastDirection == 'NORTH') erm_CaseData[currentCaseName].allowNorth = false;
        if(lastDirection == 'SOUTH') erm_CaseData[currentCaseName].allowSouth = false;
        if(lastDirection == 'EAST') erm_CaseData[currentCaseName].allowEast = false;
        if(lastDirection == 'WEST') erm_CaseData[currentCaseName].allowWest = false;

        // Remove from Case Data & history
        erm_CaseData[caseToClean] = {allowNorth:false, allowSouth: false, allowEast:false, allowWest:false, door:DOOR_NODOOR, zz:0};
        erm_MoveHistory.pop();

        // Draw Both Case
        erm_CleanCase(caseToClean);
        erm_DrawCase(currentCaseName, true);
    }

